import React from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

function Background1() {
    return (
        <div>
            color: #fff;
            background: linear-gradient(-45deg, #EE7752, #E73C7E, #23A6D5, #23D5AB);
            background-size: 400% 400%;

        </div>
 );
}
export default Background1;
